DROP TABLE IF EXISTS `emprestado`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `emprestado` (
  `id_emprestado` int(11) NOT NULL AUTO_INCREMENT,
  `id_livro` int(11) DEFAULT NULL,
  `id_aluno` int(11) DEFAULT NULL,
  `data_pegou` date DEFAULT NULL,
  `data_entrega` date DEFAULT NULL,
  `ent` enum('s','n') DEFAULT NULL,
  `user_cadastrou` int(11) DEFAULT NULL,
  `data_cadastrou` date DEFAULT NULL,
  PRIMARY KEY (`id_emprestado`),
  KEY `fk_livros` (`id_livro`),
  KEY `fk_alunos` (`id_aluno`),
  KEY `fk_usuarios` (`user_cadastrou`),
  CONSTRAINT `fk_alunos` FOREIGN KEY (`id_aluno`) REFERENCES `aluno` (`id_aluno`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_livros` FOREIGN KEY (`id_livro`) REFERENCES `livro` (`id_livro`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_usuarios` FOREIGN KEY (`user_cadastrou`) REFERENCES `usuario` (`id_user`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=428 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

